  "judgement": "sí",
  "continuation": "¿Que yo te envidie a ti? ¡Vaya un exceso!\nCon todo ese dinero que has juntado,\nNo vales lo que yo, que estoy tronado,\nPorque lo que yo peso es lo que peso."
}

Este es un soneto satírico del poeta español Manuel del Palacio (1831-1906), que hace una crítica a la riqueza material frente a la riqueza moral o espiritual.
